当社で扱っている商品の中でも最強の輝度を誇る「超高輝度2チップLED素子」を採用し、総トータル2.5W高出力を実現。<br>
スモール点灯で地面が照らされてしまうほどに、広範囲を強力に照射することができます。<br>
LEDの台座部分には放熱効率に優れたアルミヒートシンクを採用することで、従来の商品では実現できなかった高熱伝導率により、より内部に熱をためにくい構造となっております。<br><br>

<b>◆サイズ◆</b><br>
全長:26mm<br>
ヘッド部直径:約12mm<br>
差込部幅:約9.5mm<br><br>

<b>◆材質◆</b><br>
超高輝度2チップLED素子<br>
高効率VOSPモジュール<br>
アルミ<br>
PP<br><br>

